import React, { useState } from 'react'
import user from '../components/user';
const Compiler = () => {
    const [users, setUsers] = useState([
        { socketId: 1, username: 'aman' },
        { socketId: 2, Username: 'am2an' },
    ])
    return <div className='mainblock'>
        <div className='sidebar'>
            <div className='innersidebar'>
                <div className='logo'>
                    <img src='/logo1.png' alt='logo' className='logoimg' />
                </div>
                <h3>Connected</h3>
                <div className='connectedUsers'>
                    {
                        users.map((user) => (
                            <user key={user.socketId} Username={user.Username} />
                        ))
                    }
                </div>
            </div>
        </div>
        <div className='editorblock'>Editor goes here</div>
    </div>
};

export default Compiler;
